{
  "openapi": "3.0.3",
  "info": {
    "title": "Qinglong API",
    "description": "在 `系统设置 -> 应用设置 -> 添加应用` 生成 `client_id` 和 `client_secret`",
    "version": "2.11.3",
    "contact": {
      "name": "Qinglong API",
      "url": "https://github.com/whyour/qinglong/tree/develop/back/api"
    }
  },
  "servers": [
    {
      "description": "OpenAPI",
      "url": "http://localhost:5700/open"
    },
    {
      "description": "SystemAPI",
      "url": "http://localhost:5700/api"
    }
  ],
  "tags": [
    {
      "name": "用户",
      "description": "User"
    },
    {
      "name": "环境变量",
      "description": "Env"
    },
    {
      "name": "配置管理",
      "description": "Config"
    },
    {
      "name": "任务日志",
      "description": "Log"
    },
    {
      "name": "定时任务",
      "description": "Cron"
    },
    {
      "name": "脚本管理",
      "description": "Script"
    },
    {
      "name": "依赖管理",
      "description": "Dependence"
    },
    {
      "name": "系统管理",
      "description": "System"
    },
    {
      "name": "OpenAPI",
      "description": "Open"
    }
