  "paths": {
    "/auth/token": {
      "get": {
        "tags": [
          "用户"
        ],
        "summary": "获取用户密钥",
        "parameters": [
          {
            "name": "client_id",
            "in": "query",
            "description": "Client ID",
            "required": true,
            "schema": {
              "type": "string"
            }
          },
          {
            "name": "client_secret",
            "in": "query",
            "description": "Client Secret",
            "required": true,
            "schema": {
              "type": "string"
            }
          }
        ],
        "responses": {
          "200": {
            "description": "返回用户密钥信息",
            "content": {
              "application/json": {
                "schema": {
                  "properties": {
                    "code": {
                      "type": "integer",
                      "example": 200
                    },
                    "data": {
                      "properties": {
                        "token": {
                          "type": "string",
                          "description": "授权密钥"
                        },
                        "token_type": {
                          "type": "string",
                          "description": "标记类型"
                        },
                        "expiration": {
                          "type": "integer",
                          "description": "有效期 默认30天"
                        }
                      }
                    }
                  }
                }
              }
            }
          }
        }
      }
    },
    "/user/login": {
      "post": {
        "tags": [
          "用户"
        ],
        "summary": "系统接口登录获取用户密钥",
        "requestBody": {
          "description": "登录",
          "required": true,
          "content": {
            "application/json": {
              "schema": {
                "properties": {
                  "username": {
                    "type": "string",
                    "description": "用户名"
                  },
                  "password": {
                    "type": "string",
                    "description": "密码"
                  }
                }
              }
            }
          }
        },
        "responses": {
          "200": {
            "description": "返回用户密钥信息",
            "content": {
              "application/json": {
                "schema": {
                  "properties": {
                    "code": {
                      "type": "integer",
                      "example": 200
                    },
                    "data": {
                      "properties": {
                        "token": {
                          "type": "string",
                          "description": "授权密钥"
                        },
                        "lastip": {
                          "type": "string",
                          "description": "登录IP"
                        },
                        "lastaddr": {
                          "type": "string",
                          "description": "登录IP归属地"
                        },
                        "lastlogon": {
                          "type": "integer"
                        },
                        "retries": {
                          "type": "integer"
                        },
                        "platform": {
                          "type": "string",
                          "description": "登录设备"
                        }
                      }
                    }
                  }
                }
              }
            }
          }
        }
      }
    },
